  "translationLines": [
    {
      "lineNumber": 89991,
      "originalJapaneseLine": "「あはは、みんな顔に出やすいから、",
      "translatedEnglishLine": "\"Ahaha, everyone's expressions are easy to read,\""
    },
    {
      "lineNumber": 89992,
      "originalJapaneseLine": "　一発でバレバレなんだもん」",
      "translatedEnglishLine": " \"so it's obvious at just one glance.\""
    },
    {
      "lineNumber": 89993,
      "originalJapaneseLine": "「アルカネーゼまで！？」",
      "translatedEnglishLine": "\"Even Arkaneze!?\""
    },
    {
      "lineNumber": 89994,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 89995,
      "originalJapaneseLine": "クルックーが自分の顔をむにむにと弄る。",
      "translatedEnglishLine": "Kurukuu fiddled with her own face, squishing it gently."
    },
    {
      "lineNumber": 89996,
      "originalJapaneseLine": "「私、そんな顔に出やすいですか？」",
      "translatedEnglishLine": "\"Do I really show my feelings that easily on my face?\""
    },
    {
      "lineNumber": 89997,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 89998,
      "originalJapaneseLine": "「出やすいよなぁ？」",
      "translatedEnglishLine": "\"You do show it easily, don't you?\""
    },
    {
      "lineNumber": 89999,
      "originalJapaneseLine": "「ですよねぇ？」",
      "translatedEnglishLine": "\"Right?\""
    },
    {
      "lineNumber": 90000,
      "originalJapaneseLine": "「アニキもずっと近くにいたら、",
      "translatedEnglishLine": "\"If you're always close by, Aniki,"
    },
    {
      "lineNumber": 90001,
      "originalJapaneseLine": "　なんとなく分かるようになるよ」",
      "translatedEnglishLine": " you get to understand it somehow.\""
    },
    {
      "lineNumber": 90002,
      "originalJapaneseLine": "「ぐ、ぐぐぐ……」",
      "translatedEnglishLine": "\"G-gu-gu...\""
    },
    {
      "lineNumber": 90003,
      "originalJapaneseLine": "ランスがクルックーの顔を睨みつける。",
      "translatedEnglishLine": "Rance glared intently at Kurukuu's face."
    },
    {
      "lineNumber": 90004,
      "originalJapaneseLine": "「うむむむ……」",
      "translatedEnglishLine": "\"Ummmmm...\""
    },
    {
      "lineNumber": 90005,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 90006,
      "originalJapaneseLine": "「駄目だ、分からん！」",
      "translatedEnglishLine": "\"No good, I can't tell!\""
    },
    {
      "lineNumber": 90007,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 90008,
      "originalJapaneseLine": "「……あまり、ジロジロ見ないで下さい」",
      "translatedEnglishLine": "\"...Please don't stare too much.\""
    },
    {
      "lineNumber": 90009,
      "originalJapaneseLine": "「なんだとぉ？」",
      "translatedEnglishLine": "\"What did you say!?\""
    },
    {
      "lineNumber": 90010,
      "originalJapaneseLine": "（あれ？　今、照れた？）",
      "translatedEnglishLine": "(Huh? Did she just get embarrassed?)"
    },
    {
      "lineNumber": 90011,
      "originalJapaneseLine": "行軍の最中、クルックーが不意に立ち止まる。",
      "translatedEnglishLine": "During the march, Kurukuu suddenly stopped."
    },
    {
      "lineNumber": 90012,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 90013,
      "originalJapaneseLine": "「あん？　どうした？」",
      "translatedEnglishLine": "\"Hm? What's wrong?\""
    },
    {
      "lineNumber": 90014,
      "originalJapaneseLine": "「すみません、足を挫いてしまいました」",
      "translatedEnglishLine": "\"Sorry, I've twisted my ankle.\""
    },
    {
      "lineNumber": 90015,
      "originalJapaneseLine": "「よし、置いていこう」",
      "translatedEnglishLine": "\"Alright, let's leave you behind.\""
    },
    {
      "lineNumber": 90016,
      "originalJapaneseLine": "「アホ」",
      "translatedEnglishLine": "\"Idiot.\""
    },
    {
      "lineNumber": 90017,
      "originalJapaneseLine": "「あいたぁ！　何をするか！」",
      "translatedEnglishLine": "\"Ouch! What are you doing!?\""
    },
    {
      "lineNumber": 90018,
      "originalJapaneseLine": "「しかし、挫いたって",
      "translatedEnglishLine": "\"But you say you twisted it,"
    },
    {
      "lineNumber": 90019,
      "originalJapaneseLine": "　歩いてるだけで挫いたのか？」",
      "translatedEnglishLine": " did you twist it just by walking?\""
    },
    {
      "lineNumber": 90020,
      "originalJapaneseLine": "「いえ……",
      "translatedEnglishLine": "\"No..."
    },
    {
      "lineNumber": 90021,
      "originalJapaneseLine": "　先ほどの魔物との戦闘で、だと思います。",
      "translatedEnglishLine": " I think it happened during the fight with the monsters earlier."
    },
    {
      "lineNumber": 90022,
      "originalJapaneseLine": "　気づきませんでした」",
      "translatedEnglishLine": " I didn't realize it.\""
    },
    {
      "lineNumber": 90023,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 90024,
      "originalJapaneseLine": "「仕方ないな。どっこいせ」",
      "translatedEnglishLine": "\"Can't be helped. Here, hop on.\""
    },
    {
      "lineNumber": 90025,
      "originalJapaneseLine": "「あっ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 90026,
      "originalJapaneseLine": "クルックーがひょいと担ぎ上げられる。",
      "translatedEnglishLine": "Kurukuu was suddenly picked up and carried."
    },
    {
      "lineNumber": 90027,
      "originalJapaneseLine": "「ランス……",
      "translatedEnglishLine": "\"Rance..."
    },
    {
      "lineNumber": 90028,
      "originalJapaneseLine": "　そんなことしてもらわなくても、大丈夫です」",
      "translatedEnglishLine": " You don't have to do that, I'm fine.\""
    },
    {
      "lineNumber": 90029,
      "originalJapaneseLine": "「馬鹿、このまま歩く気か」",
      "translatedEnglishLine": "\"Idiot, do you plan to keep walking like this?\""
    },
    {
      "lineNumber": 90030,
      "originalJapaneseLine": "「ですが……」",
      "translatedEnglishLine": "\"But...\""
    },
    {
      "lineNumber": 90031,
      "originalJapaneseLine": "「…………」",
      "translatedEnglishLine": "\"........\""
    },
    {
      "lineNumber": 90032,
      "originalJapaneseLine": "　",
      "translatedEnglishLine": " "
    },
    {
      "lineNumber": 90033,
      "originalJapaneseLine": "　　＜どきん、どきん、どきん……＞",
      "translatedEnglishLine": "  <Thump, thump, thump...>"
    },
    {
      "lineNumber": 90034,
      "originalJapaneseLine": "「……？？」",
      "translatedEnglishLine": "\"...?\""
    },
    {
      "lineNumber": 90035,
      "originalJapaneseLine": "「？　どうした」",
      "translatedEnglishLine": "\"? What's wrong?\""
    },
    {
      "lineNumber": 90036,
      "originalJapaneseLine": "「いえ、どうやら体の調子が悪いようです。",
      "translatedEnglishLine": "\"No, it seems my body isn't feeling well."
    },
    {
      "lineNumber": 90037,
      "originalJapaneseLine": "　すみませんが、このままお願いします」",
      "translatedEnglishLine": " Sorry, please keep carrying me like this.\""
    },
    {
      "lineNumber": 90038,
      "originalJapaneseLine": "「ん、まあそれはいいが……」",
      "translatedEnglishLine": "\"Hmm, well that's fine, but...\""
    },
    {
      "lineNumber": 90039,
      "originalJapaneseLine": "「しかし、怪我しても気づかんとは。",
      "translatedEnglishLine": "\"But to not even notice an injury..."
    },
    {
      "lineNumber": 90040,
      "originalJapaneseLine": "　クルックーは自分のことは鈍感なところがあるな」",
      "translatedEnglishLine": " Kurukuu really is quite oblivious about herself.\""
    }
  ]
}

